import React from 'react'
import { Link } from 'react-router-dom'

const FollowingList = ({ followingUser }) => {
  return (
    <div className="following_wrapper">
      <div className="card z-depth-0 white following">
        {followingUser && followingUser.length > 0
          ? <div>
            {followingUser && followingUser.map(followingUser => {
              return(
              <div key={followingUser.id}>
                <Link to={'../profile/' + followingUser.userid}>
                  <ul>
                    <li>
                      <span>
                        {followingUser.name}
                      </span>
                    </li>
                  </ul>
                </Link>
              </div>
              )
            })}
            </div>
          : <div><span>nothing yet</span></div>}
      </div>
    </div>
  )
}

export default FollowingList
